import React from 'react'
import '../css/Home.css'

class RPE extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            RPEChart: Array(9).fill(0).map(row => new Array(13).fill(''))
        }

        this.initializeChart();
    }

    initializeChart() {
        let yAxis = new Array(9);
        for(let i = 0; i < yAxis.length; i++) {
            yAxis[i] = new Array(13);
        }

        yAxis[0][0] = "@"

        let rpe = 10.0;
        for(let i = 1; i < yAxis.length; i++) {
            yAxis[i][0] = rpe;
            rpe = rpe -.5
        }

        let reps = 1;
        for(let i = 1; i < yAxis[0].length; i++) {
            yAxis[0][i] = reps;
            reps = reps + 1;
        }


        console.log("set state");

        this.setState({
            RPEChart: yAxis
        })
    }

    render() {
        return (
            <div>

            <div>RPE go here mother fucker</div>
            {this.state.RPEChart[0][0]}
            {this.state.RPEChart[0].length}
            </div>
        )
    }


}

export default RPE
